script: |
  super -f text -I q9125.spq | sort > q9125.out

inputs:
  - name: q9125.spq
    data: |
      SELECT DISTINCT col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( NULL ) NOT BETWEEN - + 16 / - ( + - 48 ) * - - col2 - + col2 * + CAST ( NULL AS REAL ) AND + col0;
  - name: tab0

outputs:
  - name: q9125.out
    data: |
